  \"2016-07-13T18:45:55.618356\",\n\t\"name\": \"womens-business-center\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Women's Business Centers (WBCs) represent
  a national network of nearly 100 educational centers throughout the United States
  and its territories, which are designed to assist women in starting and growing
  small businesses. WBCs seek to \"level the playing field\" for women entrepreneurs,
  who still face unique obstacles in the business world. SBAu2019s Office of Womenu2019s
  Business Ownership (OWBO) oversees the WBC network, which provides entrepreneurs
  (especially women who are economically or socially disadvantaged) comprehensive
  training and counseling on a variety of topics in several languages\",\n\t\"license_title\":
